// @ts-ignore
jest.mock('fs', () => {
    const mockFs = require('memfs').fs;
    return {
        ...mockFs,
        existsSync(path) {
            if (path.endsWith('.node')) {
                return true;
            }
            else {
                return mockFs.existsSync(path);
            }
        },
    };
});
